import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import SignUpComponent from './component/SignUpComponent'
//import SignUpComponent from './component/SignUpComponent'
import './App.css';
import Navbar from './component/Navbar';
import {ReactComponent as Calendar} from "./icons/calendar-date.svg";

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path='/signup' element={ < SignUpComponent></SignUpComponent>}></Route>
        <Route exact path='/nav' element={<div>< Navbar> 
          <NavItem  icon = {<Calendar></Calendar>} /> 
          <NavItem icon = {<Calendar/>} /> 

          </Navbar> < SignUpComponent></SignUpComponent> </div>}>
        </Route>
      </Routes>
    </Router>
  );
}

function NavItem(props){
  return(
      <li className='nav-item'>
          <a href='/signup' className='icon-button'>
              {props.icon}
          </a>
      </li>
  );
}

export default App;
